//import React, { useState } from 'react';
import BotaoMenu from "./componentes/BotaoMenu";
import PropTypes from 'prop-types';

function App(props) {
  //const [agendaVisivel, setAgendaVisivel] = useState('');
  //const [cadastroVisivel, setCadastroVisivel] = useState('');
  //const [avaliacaoVisivel, setAvaliacaoVisivel] = useState('');
  //const [mensalidadeVisivel, setMensalidadeVisivel] = useState('');

  function teste(titulo){
    if(titulo=="Agenda"){
      return console.log("Agenda");
    } else if(titulo=="Cadastro Paciente"){
      return console.log("Cadastro Paciente");
    } else if(titulo=="Avaliação Acupuntura"){
      return console.log("Avaliação Acupuntura");
    } else {
      return console.log("Mensalidade");
    }
  }

  function chamarAgenda(){
    console.log("Agenda");
    this.conteudoPagina = "Agenda";
  }


  return (
    <div>
      <div className="centralizado">
        <p className="titulo">Clínica Integrità</p>
        <BotaoMenu onClick={chamarAgenda} titulo="Agenda"></BotaoMenu>
        <BotaoMenu onClick={teste} titulo="Cadastro Paciente"></BotaoMenu>
        <BotaoMenu onClick={teste} titulo="Avaliação Acupuntura"></BotaoMenu>
        <BotaoMenu onClick={teste} titulo="Mensalidade"></BotaoMenu>
      </div>
      <div id="conteudo">
        {conteudoPagina}
      </div>
    </div>
  );
}

Item.propTypes = {
  conteudoPagina: PropTypes.string
}

export default App;
